Medical Milk Maids

Featuring: Lady Nina Birch &amp; Mistress Sidonia


WMV only.


Signing up to become a sperm donor at this clinic is not quite as much fun as expected for this poor patient. The two stern medical nurses treat him as an anonymous piece of meat, their only goal to extract as much seamen, as possible, from his aching balls. He may of received some pleasure from the first extraction, but after four more, by hand and machine he gains no more thrills. The weeks contract he signed offers little hope of this!

